import styled from 'styled-components';

export const Item = styled.li`
    width: 100%;
    margin: 10px 0;
    border-radius: 10px;
    box-shadow: rgba(0, 0, 0, 0.08) 0 0 0 1px;
    display: flex;
    justify-content: space-between;
`;

export const ItemContainer = styled.div`
    display: flex;
`;
